Here is the Solidity smart contract code based on your description:

```solidity
pragma solidity ^0.5.16;

contract MyContract {
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalsupply;
    uint256 public icoratio;
    uint256 public icoendtime;
    address public icosender;
    address public icoholder;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;

    constructor() public {
        totalsupply = 0xadb53acfa41aee12000000;
        name = "0";
        symbol = "0";
        decimals = 18;
        icoratio = 0x15b38;
        icoendtime = 0x5a967da0;
        icosender = 0xf043AE16a61ECe2107eb2bA48DcC7AD1C8f9F2dC;
        icoholder = 0xf043AE16a61ECe2107eb2bA48DcC7AD1C8f9F2dC;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function withdraw() public {
        require(msg.sender == icoholder);
        msg.sender.transfer(address(this).balance);
    }

    function() external payable {
        require(now < icoendtime);
        uint256 amount = msg.value * icoratio * 10**uint(decimals) / 1 ether;
        require(balanceof[icosender] >= amount);
        balanceof[icosender] -= amount;
        balanceof[msg.sender] += amount;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= allowance[_from][msg.sender]);
        allowance[_from][msg.sender] -= _value;
        require(balanceof[_from] >= _value);
        require(balanceof[_to] + _value >= balanceof[_to]);
        balanceof[_from] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceof[msg.sender] >= _value);
        require(balanceof[_to] + _value >= balanceof[_to]);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }
}
```
The contract has standard ERC20 functions like `approve`, `transferFrom`, and `transfer`. It also has an ICO function where people can send Ether to the contract and get tokens in return. The `withdraw` function allows the ICO holder to withdraw the Ether collected during the ICO. The constructor initializes the contract with the initial total supply and other parameters.
